(41,19,'compile.plg',2,'#!/usr/bin/env swipl\n\n:- use_module(library(qsave)).\n:- dynamic(loading/1).\n:- asserta(loading(0)).\n\n% The first hook is for detectin\n% loading state\n\nuser:message_hook(Term, _, _) :-\n    (   Term = load_file(start(Level, _))\n    ->  asserta(loading(Level))\n    ;   (   Term = load_file(done(Level, _, _, _, _, _))\n        ->  retractall(loading(Level))\n        ;   true)),\n    false.\n\n% The second hook shuts down SWI when\n% an error occurs during loading.\n\nuser:message_hook(Term, error, _):-\n    loading(_),\n    message_to_string(Term, String),\n    write(user_error, String), nl(user_error),\n    halt(2).\n\n% Main compilation function, this loads the file,\n% checks that \'main\' exists, and saves it as a\n% standalone executable.\n\ndomjudge_compile([Source,Dest]) :-\n    % Load the user source\n    consult(Source),\n\n    % Check that main exists\n    (\n        current_predicate(main/0)\n     ;  write(user_error, \'main/0 not found\'),\n        nl(user_error),\n        halt(3)\n    ),\n\n    % Create the executable\n    qsave_program(Dest, [ goal((main,halt)), % We should execute main and then exit successfully\n                          toplevel(halt(1)), % If not, we should exit with exit code 1\n                          stand_alone(true) ]),\n\n    % Exit successfully\n    halt.\n\n% If previous case is not matched we apparently got a different number of arguments.\ndomjudge_compile(_) :-\n    write(user_error, \'Usage ./compile.plg <source file> <dest>\'),\n    nl(user_error),\n    halt(1).\n\n% Executed on start, calls the compilation\n% function with the commandline arguments.\n:- current_prolog_flag(argv, Arguments),\n   domjudge_compile(Arguments).\n\n','c0340809a8d80db4e1cb6d9100cd8303',0),
(42,20,'run',0,'#!/bin/sh\n\n# Python3 compile wrapper-script for \'compile.sh\'.\n# See that script for syntax and more info.\n#\n# This script does not actually \"compile\" the source, but writes a\n# shell script that will function as the executable: when called, it\n# will execute the source with the correct interpreter syntax, thus\n# allowing this interpreted source to be used transparently as if it\n# was compiled to a standalone binary.\n# Note that from version 8.0.0 the default Python 3 interpreter is\n# pypy 3 instead of CPython 3.\n#\n# This script requires that pypy3 is installed in the chroot.\n\nDEST=\"$1\" ; shift\nMEMLIMIT=\"$1\" ; shift\nMAINSOURCE=\"${ENTRY_POINT:-$1}\"\n\n# Report the entry point, so it can be saved, e.g. for later replay:\nif [ -z \"$ENTRY_POINT\" ]; then\n    echo \"Info: detected entry_point: $MAINSOURCE\"\nfi\n\n# Check syntax\npypy3 -m py_compile \"$@\"\nEXITCODE=$?\n[ \"$EXITCODE\" -ne 0 ] && exit $EXITCODE\nrm -f -- *.pyc\nrm -rf -- __pycache__\n\n# Check if entry point is valid\nif [ ! -r \"$MAINSOURCE\" ]; then\n    echo \"Error: main source file \'$MAINSOURCE\' is not readable\" >&2\n    exit 1\nfi\n\n# Write executing script:\ncat > \"$DEST\" <<EOF\n#!/bin/sh\n# Generated shell-script to execute python interpreter on source.\n\n# Detect dirname and change dir to prevent class not found errors.\nif [ \"\\${0%/*}\" != \"\\$0\" ]; then\n	cd \"\\${0%/*}\"\nfi\n\n# set non-existing HOME variable to make python happy\nexport HOME=/does/not/exist\n\n# Uncomment the line below if you want it make easier for teams to do local\n# debugging.\n# export ONLINE_JUDGE=1 DOMJUDGE=1\n\nexec pypy3 \"$MAINSOURCE\" \"\\$@\"\nEOF\n\nchmod a+x \"$DEST\"\n\nexit 0\n','363e0ece9c64c22720e11cff44e5fd61',1),
